import * as React from "react";
// import "./styles.css";
import { List } from "./List";

/**
 * Get a list of Star Wars people using:
 * https://swapi.dev/api/people/
 *
 * Pass this data to the <List /> component and render
 * typical attributes like name, age, etc.
 **/

export default function App() {
  const [people, setPeople] = React.useState([]);

  const options = {
    method: "GET"
  };
  fetch("https://swapi.dev/api/people/", options)
    .then((response) => response.json())
    // .then((response) => console.log("response", response))
    // .then((data) => console.log("This is the data.results", data.results))
    .then((data) => setPeople(data.results));

  console.log("here are the people", people);

  console.log("people", people);
  return (
    <div className="App">
      <h1>Hello CodeSandbox</h1>
      <h2>Start editing to see some magic happen!</h2>
      <List characters={people} />
    </div>
  );
}
